import CartIcon from "../../images/cart.jpg"
export default function Cart() {
	return(
		<Container>
			<StyledIcon>
				{/* <img src={CartIcon} alt="" /> */}
				<i className="fal fa-shopping-cart"></i>
			</StyledIcon>
			<StyledCart>

			</StyledCart>
		</Container>
	)
}

